def get_field_list_from_file():
    file_field_desc = []

    with open(CSV_PATH) as csvfile:
        for num, line in enumerate(csvfile, 1):
            if num == 1:
                continue

            line = line.replace('\n', '')

            if '"' in line:
                line_split = re.split(',"|', line)
            else:
                line_split = line.split(',')

            file_field_desc.append({'name':line_split[0], 'description':line_split[1]})

    return file_field_desc


def remove_pii(field_list):
    no_pii_list = json.loads(NO_PII_LIST)

    for field in list(field_list):
        keep_row = False

        for field_pii in no_pii_list:
            if field['name'].lower() == field_pii['name'].lower():
                keep_row = True
                break

        if not keep_row:
            field_list.remove(field)


def insert_fields_into_mongo(field_list):
    app_db = atp_classes.AppDB()

    for field in field_list:
        app_db.add_to_collection('fields', field)


